import {useState, useEffect} from "react";

function JudgeApp() {      

    return (
        <div>
            <h1 style={{textAlign: 'center', fontFamily: 'Helvetica, sans-serif', fontStyle: 'oblique', color: 'white', paddingTop: 400, fontSize: '76px'}}>
                Welcome
            </h1>
            <div style={{display: 'flex', justifyContent: 'space-around', paddingLeft: 750, paddingRight: 750}}>
                <button>Admin page</button>
                <button>Logout</button>
            </div>
        </div>
    );
  }

  export default JudgeApp;
